import React from "react";
import { Route, Switch } from "react-router-dom";

import home from "./larsen/home";
import grid from "./larsen/grid";
import geo from "./larsen/geo";
import product from "./larsen/product";
import pi from "./larsen/pi";
import counter from "./larsen/counter";

class Routes extends React.Component {
  render() {
    return (
      <Switch>

        <Route exact path ="/"component={home}/>
        <Route exact path ="/grid"component={grid}/>
        <Route exact path ="/geo"component={geo}/>
        <Route exact path ="/product"component={product}/>
        <Route exact path ="/pi"component={pi}/>
        <Route exact path ="/counter"component={counter}/>


        <Route
          render={function () {
            return <h1>Not Found</h1>;
          }}
        />
      </Switch>
    );
  }
}

export default Routes;
